import "../App.css";

export const Form = () => {
    return (
        <div>
            <form className="newTaskForm">
                <input type="text" placeholder="Name of the task"></input>
                <input type="time" placeholder="Start Time"></input>
                <input type="time" placeholder="End Time"></input>
                <textarea placeholder="Task Notes" rows={5} cols={5}></textarea>
            </form>
        </div>
    );
}
